import './App.css';
import "bootstrap/dist/css/bootstrap.min.css"
import HomePage from './components/Homepage';
import {
  BrowserRouter ,
  Route,
  Routes,

} from "react-router-dom";

function App() {
  return (
    <>
     <div className="App">

     <Routes>
              <Route path="/" element={<HomePage />} exact />

            </Routes>
      <div> <HomePage/></div>
    </div>
    <BrowserRouter/>

    </>

  );
}

export default App;
